import React from 'react';
import { Routes, Route } from 'react-router-dom'; // Ya no necesitas BrowserRouter aquí
import EventList from './EventList';
import './App.css';


function App() {
    return (
        <div className="App">
            <Routes>
                <Route path="/" element={<EventList />} />
                <Route path="/scanner/:eventId" element={<h2>Scanner Placeholder</h2>} />
            </Routes>
        </div>
    );
}

export default App;
